import './App.css';
import data from './data';
import Display from './Display';
import React from "react";
import './App.css';
import Navbar from './components/navbar/Navbar'


function App() {

  return (
    <div className="App">

    <Navbar/>

    {
      data.map(x => <Display item={x}/>)
    }

    </div>
  );
}

export default App;
